# NOTE: this class should be generated by the new code gen, and never manually touched after
from gameObject import GameObject

class GeneratedChecker(GameObject):
    def __init__(self, data):
        GameObject.__init__(self, data)

        self.owner = None
        self.x = 0
        self.y = 0
        self.kinged = False

    def move(self, x, y):
        return self._ai.send_command(self, "move",
            x=x,
            y=y
        )
